import React, { Component } from 'react';
import './App.css';
import { AppFrame } from './Components';
import Dashboard from './Pages/Dashboard';


class App extends Component {

  state = {
    page : <Dashboard/>
  }

  render() {
    return (
      <div className="App">
        <AppFrame/>
        <Dashboard/>
      </div>
    );

  }
}

export default App;
